function add(x){function adds(y,yy){return y==x?yy:y>x?null:adds(y+3,`(${yy}+3)`)||adds(3*y,`(${yy}*3)`)}return adds(1,"1")}function findSolution(target){function find(current,history){return current==target?history:current>target?null:find(current+5,`(${history}+5)`)||find(3*current,`(${history}*3)`)}return find(1,"1")}$.ajax({url:"../data.json",success:function(data){console.log(data),$(".imgs").attr("src",data.img)},error:function(err){console.log(err)}});